  \"2013-03-14T19:24:19.693464\",\n\t\"name\": \"crestridge-plant-surveys-ds210\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sensitive plant surveys were conducted
  in 2000 for development of a Habitat Management and Monitoring Plan by Patricia
  Gordon-Reedy of the Conservation Biology Institute (CBI) and Fred Sproul, an independent
  consultant, at the Department of Fish and Game's Crestridge Ecological Reserve.
  These surveys focused on locating, mapping, and estimating population size for Multiple
  Species Conservation Program (MSCP) covered species, i.e., those species for which
  special conservation and management measures are required by the MSCP take authorizations.
  Two MSCP covered plant species were detected on Crestridge during the surveys in
  2000, San Diego thornmint (Acanthomintha ilicifolia) and Lakeside ceanothus (Ceanothus
  cyaneus). Cleveland's goldenstar (Muilla clevelandii) was detected just offsite
  to the east. Slender-pod jewelflower (Caulanthus stenocarpus) was also detected
  in one location on Crestridge. This species has undergone a taxonomic revision since
  originally being placed on the MSCP covered spec widespread, common taxon (C. heterophyllus
  var. heterophyllus). Therefore, this taxon was not mapped or recorded as a sensitive
  species. The plant survey, vegetation monitoring, and data collection protocols
  used and those recommended for future use are documented in CBI's management and
  monitoring plan.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
